import React, { Component } from 'react';

class BasicInfo extends Component {
  render() {
    const { person } = this.props;

    return (
      <div>
        <h1>Name: {person.name}</h1>
        <p>Number: {person.number}</p>
        <p>Date of Birth: {person.dateOfBirth}</p>
      </div>
    );
  }
}

export default BasicInfo;
